import axios from "axios";
import { ref } from "vue";

export default function backend(url) {
  const apiUrl = 'http://localhost:8000/api/';
  const apiData = ref();

  const apiCall = async () => {
    const apiDatas = ref();

    const response = await fetch(apiUrl+"calendar/week")
      .then(res => res.json()).then(resJson => {
      apiDatas.value = resJson;
    });

    return apiDatas.value;
  }
  console.log(apiCall());

  return {
    apiData
  }
}
